import React from 'react';

function Users({name, surname,age}) {
    <table>
        <tr>
            <td>
                  {name};  
            </td>
            <td>
                   {surname}; 
            </td>
            <td>
                    {age};
            </td>
        </tr>
    </table>

}

export default Users;
